import React from "react";

const Footer = () => (
  <footer>
    <div>
      Creado por <a href="https://codealo.dev">Deiver Quinto Martinez</a>
    </div>
    <div>
      <a href="https://instagram.com/codealo">Siguenos en Instagram</a>
    </div>
  </footer>
);

export default Footer;
